    false,nt"url": null,nt"notes": "These reports summarize bat calls collected
    along transects at Noxubee National Wildlife Refuge between 2012 and 2015. Calls
    were classified using Bat Call ID ([BCID] version 2.5a) software and restricted
    to calls with 5 or more pulses.  This annual summary report contains summary information
    on transect surveys, species detections, maps of species locations.  Summary tables
    include all classified species observations including those that did not have an
    associated spatial reference. The report summarizes acoustical bat data from a survey
    route run at Noxubee National Wildlife Refuge between 2012 and 2015.",nt"license_title":
